export const Navbar = (props) => {
  return (
    <div
      style={{
        flexDirection: "row",
        marginBottom: 24,
        display: "flex",
        fontSize: 12,
        marginTop: 8,
      }}
    >
      <div style={{ width: "40%" }}>AAKASH ADESARA</div>
      <div style={{ width: "15%", textAlign: "center", cursor: "pointer" }}>
        WORK
      </div>
      <div style={{ width: "15%", textAlign: "center" }}>WRITING</div>
      <div style={{ width: "15%", textAlign: "center" }}>ART</div>
      <div style={{ width: "15%", textAlign: "center" }}>BOOKS</div>
    </div>
  );
};
